とりあえず、「セブン　ネットプリント」で検索して、ユーザー登録する（本名等入れても、印刷時には表示されないから大丈夫）
登録したら、ログインして「ファイル登録・一覧」ページでファイル登録の「フォト用紙にプリント」を選択。あとは印刷したい画像をそこに入れればOK！

@UN1056 
ファイル登録が済んだら、一覧ページに「プリント予約番号」が表示される。それを皆さんに教えれば、各々がセブンのプリンターにその番号を打ち込んで印刷できるという仕組み。
印刷の細かい設定とか決められるけど、別に変える必要ないし、サイト自体分かりやすいから大丈夫だよ。

